import React from 'react';

function List({ data }) {
  const handleEditClick = (postId) => {
    console.log(`Edit button clicked for post ${postId}`);
  };

  const handleDeleteClick = (postId) => {
    console.log(`Delete button clicked for post ${postId}`);
  };
  return (
    <div className="list">
      {data.map((item) => (
        <div className="list-item" key={item.post_id}>
          <div className="list-item-text">
            <h2 className="list-item-title">{item.title}</h2>
            <p className="list-item-content">{item.content}</p>
            <img src={item.imageUrl} alt="Item" className="list-item-image" />
          </div>
          <div className={styles['list-item-buttons']}>
              <button className={styles.button} onClick={() => handleEditClick(item.post_id)}>
                수정하기
              </button>
              <button className={styles.button} onClick={() => handleDeleteClick(item.post_id)}>
                삭제하기
              </button>
            </div>
        </div>
      ))}
    </div>
  );
}

export default List;
